import SongArtist from './SongArtist';
import SongLyrics from './SongLyrics';


const SongDetails = ({search, lyrics}) => {
    return ( 
        <div className='container'>
        <SongArtist data={search}/>

        <SongLyrics lyrics={lyrics}/>
        </div>
     );
}

export default SongDetails;
